import "./Portfolio.css";

export function Portfolio() {
  return (
    <div className="portfolio-page flex">
      <div className="portfolio-page-container">
        <div className="portfolio-title section-title">
          Portfolio <span>.</span>
        </div>

        {/* rest of the stuff */}
      </div>
    </div>
  );
}

class PortfolioItem {
  title: string;
  description: string;
  preview: string;
  link: string;
  date: string;


  constructor(
    title: string,
    subtitle: string,
    logo: string,
    link: string,
    date: string,
    id?: string
  ) {
    this.title = title;
    this.description = subtitle;
    this.preview = logo;
    this.link = link;
    this.date = date;
  }
}
